import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('rulesFile', () => {
    test('ok', async () => {
        const r1 = await request('http://rf1.w2.org/index.html');
        expect(r1.data).toHaveProperty('test', 'values');
        const r2 = await request('http://rf2.w2.org/index.html');
        expect(r2.data).toHaveProperty('test', 'values2');
        const r3 = await request('http://rf3.w2.org/index.html');
        expect(r3.data).toHaveProperty('test', 'values3');
    });
});
